/* Draw winner screen */
void draw_winner_screen(){
    // Local Variable Declaration
    int x = 0, y = 0;

    // Traverse through all pixels
    for (int i = 0; i < 320 * 2 * 240 - 1; i += 2) {
        short int color = (winner_image[i+1] << 8) | winner_image[i];

        plot_pixel(x, y, color);
        x++;
        
        // Check if end of row is reached
        if (x == 320) {
            x = 0;
            y += 1;
        }
    }
}


/* Draw rectangle */
void draw_rectangle(int x, int y, int width, int height, short int color){
    // Draw black rectangle
    for (int j = y; j < y + height; ++j){
       for (int i = x; i < x + width; ++i){
           plot_pixel(i, j, color);
       } 
    }
    
    // Draw line border
    // Top
    draw_line(x, y, x+width-1, y, 0xFFFF);
    draw_line(x, y+1, x+width-1, y+1, 0xFFFF);
    
    // Left
    draw_line(x, y, x, y+height-1, 0xFFFF);
    draw_line(x+1, y, x+1, y+height-1, 0xFFFF);
    
    // Right
    draw_line(x+width-1, y, x+width-1, y+height-1, 0xFFFF);
    draw_line(x+width-2, y, x+width-2, y+height-1, 0xFFFF);
    
    // Bottom
    draw_line(x, y+height-1, x+width-1, y+height-1, 0xFFFF); 
    draw_line(x, y+height-2, x+width-1, y+height-2, 0xFFFF);
}


/* Action for title screen */
void state_title_screen(){
    // Title Screen
    clear_text();
    draw_title_screen();
    wait_for_vsync();

    wait_for_title_input();
    clear_text();
}


/* Waiting for the user to select winning value in title screen*/
// Code Reference: http://www-ug.eecg.toronto.edu/msl/nios_devices/dev_ps2.html
void wait_for_title_input(){
    // Local Variable Declaration
    unsigned char byte1 = 0;
    unsigned char byte2 = 0;
    unsigned char byte3 = 0;
    int PS2_data = 0, RVALID = 0;
    
    // Get PS/2 Base Address
    volatile int * PS2_ptr = (int *) 0xFF200100;
    
    // Continuously read user input
    while (winningMoney == UNINITIALIZED) {
        PS2_data = *(PS2_ptr);	// read the Data register in the PS/2 port
        RVALID = (PS2_data & 0x8000);	// extract the RVALID field
        if (RVALID != 0)
        {
            // Save last 3 bit from PS2 data
            byte1 = byte2;
            byte2 = byte3;
            byte3 = PS2_data & 0xFF;
        }
        
        // Check for correct user input
        // Option 1 clicked
        if (byte2 == 0xF0 && byte1 == 0x16){
            winningMoney = 1000;
        }
        // Option 2 clicked
        else if (byte2 == 0xF0 && byte1 == 0x1E){
            winningMoney = 5000;
        }
        // Option 3 clicked
        else if (byte2 == 0xF0 && byte1 == 0x26){
            winningMoney = 10000;
        }
    }
    
    clear_text();
}


/* Action for game screen */
void state_game_screen(){
    draw_game_screen();
    wait_for_vsync();
        
    // Game Screen
    while (winner == UNINITIALIZED)
    {
        draw_game_screen();
        wait_for_vsync();
        
        // User turn
        int diceMove = roll_dice();
        
        // Player 1's turn
        if (gameTurn == PLAYER_1){
            increment_position1(diceMove);
            
            // Action according to position
            if (position1 == START){
                display_start_dialog();
                playerMoney1 += 100;
            }
            else if (position1 == POLICE){
                display_police_dialog();
                position1 = JAIL;
                draw_game_screen();
                wait_for_vsync();    
            }
            else if (position1 == JAIL){
                // Do nothing
            }
            else if (position1 == CHANCE){
                display_chance_dialog();
            }
            
            // PROPERTY
            else{
                display_property_dialog1();
            }
        }
        
        if (gameTurn == PLAYER_2){
            increment_position2(diceMove);
            
            // Action according to position
            if (position2 == START){
                display_start_dialog();
                playerMoney2 += 100;
            }
            else if (position2 == POLICE){
                display_police_dialog();
                position2 = JAIL;
                draw_game_screen();
                wait_for_vsync();    
            }
            else if (position2 == JAIL){
                // Do nothing
            }
            else if (position2 == CHANCE){
                display_chance_dialog();
            }
            
            // PROPERTY
            else{
                display_property_dialog2();
            }
        }
        
        // Flip game turn
        if (gameTurn == PLAYER_1){
            gameTurn = PLAYER_2;
        }
        else if (gameTurn == PLAYER_2){
            gameTurn = PLAYER_1;
        }
        
        determineWinner();
    }
}


/* Check if there is a winner */
void determineWinner(){
    // Wins when reaching the winning value
    if (playerMoney1 >= winningMoney){
        winner = PLAYER_1;
    }
    else if (playerMoney2 >= winningMoney){
        winner = PLAYER_2;
    }
    
    // Lose when reaching 0 money
    if (playerMoney1 <= 0){
        winner = PLAYER_2;
    }
    else if (playerMoney2 <= 0){
        winner = PLAYER_1;
    }
}


/* Dialog box for property: player 2 */
void display_property_dialog2(){
    display_dialog();

    // Get price
    char price[] = "Price: $";
    char string_price[4];
    strcat(price, itoa(box_price[position2], string_price, 10));
    
    // Not occupied yet
    if (property1[position2] == 0 && property2[position2] == 0){
        plot_string(12, 25, box_name[position2]);
        plot_string(12, 27, "Would you like to buy?");
        plot_string(12, 29, price);

        update_status_message("Y = buy | N = Cancel");

        bool yes = wait_for_two_keyboard_input(0x35, 0x31);


        if (yes){
            if (playerMoney2 >= box_price[position2]){
                property2[position2] = 1;
                playerMoney2 -= box_price[position2];  
            }
            else{
                update_status_message("Not enough money!");
            }
        }


        // Clear text drawn
        plot_string(12, 25, "                      ");
        plot_string(12, 27, "                      ");
        plot_string(12, 29, "                      ");
    }
    
    // Property occupied
    else if (property1[position2] == 1){
        plot_string(12, 25, box_name[position2]);
        plot_string(12, 27, "Need to pay rent:");
        plot_string(12, 29, price);
        
        update_status_message("Press Space to pay");
         
        wait_for_keyboard_input(0x29); 
        
        playerMoney2 -= box_price[position2];
        playerMoney1 += box_price[position2];
        
        // Clear text drawn
        plot_string(12, 25, "                      ");
        plot_string(12, 27, "                      ");
        plot_string(12, 29, "                      ");
    }
    
    // Self owned
    else{
        plot_string(12, 25, box_name[position2]);
        plot_string(12, 27, "You own here");
        plot_string(12, 29, price);
        
        update_status_message("Press Space to proceed");
         
        wait_for_keyboard_input(0x29); 
        
        // Clear text drawn
        plot_string(12, 25, "                      ");
        plot_string(12, 27, "                      ");
        plot_string(12, 29, "                      ");
    }
}


